import React, { useState } from 'react';
import { CssBaseline, Container, Paper, Box, Tabs, Tab } from '@mui/material';
import OptionChain from './components/OptionChain';
import RealtimeInspector from './components/RealtimeInspector';
import { ThemeProvider, createTheme } from '@mui/material/styles';

function App() {
  const [darkMode, setDarkMode] = useState(false);
  const [activeTab, setActiveTab] = useState(0);

  const theme = createTheme({
    palette: {
      mode: darkMode ? 'dark' : 'light',
    },
  });

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
  };

  const handleTabChange = (event, newValue) => {
    setActiveTab(newValue);
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Container maxWidth="lg" sx={{ mt: 2 }}>
        <Paper elevation={3} sx={{ p: 0, overflow: 'hidden' }}>
          <Tabs
            value={activeTab}
            onChange={handleTabChange}
            textColor="primary"
            indicatorColor="primary"
            variant="fullWidth"
          >
            <Tab label="Option Chain" />
            <Tab label="Realtime Inspector" />
          </Tabs>

          <Box sx={{ height: 'calc(100vh - 128px)' }}>
            {activeTab === 0 && (
              <OptionChain darkMode={darkMode} toggleDarkMode={toggleDarkMode} />
            )}
            {activeTab === 1 && (
              <RealtimeInspector darkMode={darkMode} toggleDarkMode={toggleDarkMode} />
            )}
          </Box>
        </Paper>
      </Container>
    </ThemeProvider>
  );
}

export default App;
